syntax = "proto3";

package service.v1;

// Group Send File
message OidbSvcTrpcTcp0x6D94 {
  OidbSvcTrpcTcp0x6D94Body body = 5;
}

message OidbSvcTrpcTcp0x6D94Body {
  uint32 group_uin = 1;
  uint32 type = 2; // 2
  OidbSvcTrpcTcp0x6D94Info info = 3;
}

message OidbSvcTrpcTcp0x6D94Info {
  uint32 busi_type = 1; // 102
  string file_id = 2;
  uint32 field3 = 3; // random
  optional string field4 = 4;
  bool field5 = 5;
}
